import { Link, useLocation } from "react-router-dom";
import "n.png"
import {FaUser, FaCalendar, FaClock, FaEnvelope, FaBook, FaUserFriends, FaInfoCircle}
    from "react-icons/fa";
import {FaN} from "react-icons/fa6";

function KanbasNavigation() {
    const links = ["Home", "Account", "Dashboard", "Courses", "Inbox", "Groups", "Calendar", "Help"];
    const icons = [<FaN/>, <FaUser/>, <FaClock/>, <FaBook/>, <FaEnvelope/>, <FaUserFriends/>, <FaCalendar/>,
    <FaInfoCircle/>]
    const { pathname } = useLocation();
    return (
        <div className="list-group" style={{ width: 150 }}>
            {links.map((link, index) => (
                <Link
                    key={index}
                    to={`/Kanbas/${link}`}
                    className={`list-group-item ${pathname.includes(link) && "active"}`}>
                    {link} <h2> {icons[index]} </h2>
                </Link>
            ))}
        </div>
    );
}
export default KanbasNavigation;
